g2:c.PROCEDURE.g2:a.TEXT:
star-test(node:class benchmark-test)
pid: float;
status: truth-value;
begin
pid = call g2-spawn-process-to-run-command-line ("/g2/src/sbn/g2sbn");
wait for 2 seconds;
status = call activate-sbn-interface (2 seconds);
call deactivate-sbn-interface ();
call g2-kill-process(pid);
if status is false then call fail(node, "Could not establish GSI connection")
else call pass(node);
end

delay-test(node:class benchmark-test)
pid1: float;
pid2: float;
our-delay: integer = 5000;
delay: integer;
f: class g2-stream;
len: integer;
announce-len: integer = 36;
begin
pid1 = call g2-spawn-process-to-run-command-line("/g2/src/sbn/g2sbn");
wait for 2 seconds;
call activate-sbn-interface(2 seconds);
call set-forever-loop-wait-time(our-delay) across sbn-gsi;
delay = call set-forever-loop-wait-time(our-delay) across sbn-gsi;
pid2 = call g2-spawn-process-to-run-command-line("/bin/nc -l -u localhost 5821 >/tmp/sbn.log");
wait for 3 seconds;
call g2-kill-process(pid2); 
f = call g2-open-file-for-read("/tmp/sbn.log");
len = call g2-length-of-file(f);
call g2-close-file (f);
call g2-delete-file ("/tmp/sbn.log");
call deactivate-sbn-interface ();
call g2-kill-process(pid1);
if delay /= our-delay then call fail(node, "Delay is [delay]")
else if (len / announce-len) > 1 then call fail(node, "Log size is [len]")
else call pass(node);
end

delay-error-test(node:class benchmark-test)
pid1: float;
errobj: class error;
success1: truth-value;
begin
success1 = false;
pid1 = call g2-spawn-process-to-run-command-line("/g2/src/sbn/g2sbn");
wait for 2 seconds;
call activate-sbn-interface(2 seconds);
begin
call set-forever-loop-wait-time(-1) across sbn-gsi;
end
on error(errobj)
    success1 = true;
    delete errobj;
end;
call deactivate-sbn-interface ();
call g2-kill-process(pid1);
if success1 is false then call fail(node, "Call with wrong args succeeded")
else call pass(node);
end

app-mess-test(node:class benchmark-test)
pid1: float;
pid2: float;
len: integer;
val1: integer;
val2: integer;
begin
pid1 = call g2-spawn-process-to-run-command-line("/g2/src/sbn/g2sbn");
wait for 2 seconds;
call activate-sbn-interface(2 seconds);
pid2 = call g2-spawn-process-to-run-command-line("cd /opt/cFE/build/cpu1/exe/ && ./core-linux.bin --reset PO >/tmp/nasa.log");
wait for 3 seconds;
start sbn-subscribe(2057);
wait for 1 second;
start sbn-send-app-message(6145,0,sbn-test-payload,0);
wait for 1 second;
len = the array-length of sbn-demo-payload;
val1 = sbn-demo-payload[12];
start sbn-unsubscribe(2057);
wait for 3 seconds; 
change sbn-demo-payload[12]=0;
start sbn-send-app-message(6145,0,sbn-test-payload,0);
wait for 1 second; 
val2 = sbn-demo-payload[12]; 
call deactivate-sbn-interface ();
call g2-kill-process(pid1);
call g2-kill-process(pid2); 
if len /= 24 then call fail(node, "Payload length is [len]")
else if val1 /= 42 then call fail(node, "First byte is [val1]")
else if val2 /= 0 then call fail(node, "First byte should be 0, but is [val2]")
else call pass(node);
end
